import React from "react";
import { Switch, Route } from "react-router-dom";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
import Track from "./components/Track";
import List from "./components/List";
function App() {
  return (
    <>
      <Route path="/">
        <Navbar />
        <Home />
      </Route>
      <Route path="/list">
        <List />
      </Route>
      <Route path="/track">
        <Track />
      </Route>
      <Route>
        <Navbar />
        <Home />
      </Route>
    </>
  );
}

export default App;
